import React from "react";
import styled from "styled-components";
import MenuList from "../molecules/MenuList";

const MenuShow = styled.ul`
  display: flex;
  justify-content: flex-end;
  font-family: Kanit-Regular;
  line-height: 30px;
  font-size: 20px;
  padding: 0;
  margin: 0;
  li:not(:nth-child(1)) {
    padding-left: 32px;
  }
  li:nth-child(4) {
    opacity: 0.2;
  }
  @media screen and (max-width: 1280px) {
    display: none;
  }
`;
const HamburgerBtn = styled.a`
  position: absolute;
  right: 100px;
  margin-top: 10px;
  display: none;
  span {
    position: absolute;
    transition: 0.3s ease-in-out;
    height: 3px;
    width: 30px;
    border-radius: 7px;
    background-color: #3d4146;
    top: 0;
    transition: 0.3s;
  }
  span:nth-child(1) {
    top: -5px;
  }
  span:nth-child(2),
  span:nth-child(3) {
    top: 5px;
  }
  span:nth-child(4) {
    top: 15px;
  }
  @media screen and (max-width: 1280px) {
    display: block;
    top: 25px;
  }
`;
function NavbarMenu({ active, onToggle }) {
  return (
    <MenuShow>
      <MenuList />
      <HamburgerBtn active={active} onClick={onToggle}>
        <span />
        <span />
        <span />
        <span />
      </HamburgerBtn>
    </MenuShow>
  );
}

export default NavbarMenu;
